import React from "react";
import { motion } from "framer-motion";
import { FaBehance, FaDribbble, FaInstagram, FaEnvelope, FaPhone, FaMapMarkerAlt } from "react-icons/fa";

export default function About() {
  return (
    <div className="flex min-h-screen bg-white text-black">
      {/* Sidebar */}
      <aside className="w-1/5 p-8 bg-black text-white flex flex-col justify-between">
        <div>
          <h1 className="text-3xl font-bold">Jac.</h1>
          <nav className="mt-6">
            {["HOME", "ABOUT", "SERVICES", "WORKS", "BLOGS", "CONTACT"].map((item) => (
              <p key={item} className="text-gray-400 hover:text-white cursor-pointer mb-4">{item}</p>
            ))}
          </nav>
        </div>
        <div className="flex gap-4">
          <FaBehance size={24} />
          <FaDribbble size={24} />
          <FaInstagram size={24} />
        </div>
        <p className="text-gray-500 text-sm">Copyright ©2022 Jacob Jones. All rights reserved.</p>
      </aside>

      {/* Main Content */}
      <main className="w-4/5 p-16">
        {/* Profile Section */}
        <div className="flex items-center justify-between">
          <div className="max-w-lg">
            <p className="text-gray-600 italic">Nice to meet you!</p>
            <motion.h1
              className="text-5xl font-bold"
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ duration: 1 }}
            >
              WELCOME TO...
            </motion.h1>
            <h2 className="text-3xl font-extrabold mt-4 text-purple-700">JACOB JONES</h2>
            <p className="italic text-gray-700">Product Designer based in <span className="font-bold">London</span></p>
            <button className="mt-6 bg-black text-white px-6 py-2 rounded-lg flex items-center gap-2">
              Download CV ↗
            </button>
          </div>

          {/* Profile Image */}
          <motion.div
            className="relative w-60 h-60"
            initial={{ scale: 0.8, opacity: 0 }}
            animate={{ scale: 1, opacity: 1 }}
            transition={{ duration: 1 }}
          >
            <img src="your-profile-image.jpg" alt="Jacob Jones" className="rounded-full shadow-lg" />
            <div className="absolute inset-0 bg-gradient-to-r from-purple-500 to-orange-500 opacity-50 rounded-full"></div>
          </motion.div>
        </div>

        {/* Contact Info */}
        <div className="mt-8 grid grid-cols-2 gap-6 text-gray-800">
          <div className="flex items-center gap-3"><FaPhone className="text-gray-600" /> +77 022 444 05 05</div>
          <div className="flex items-center gap-3"><FaMapMarkerAlt className="text-gray-600" /> United Kingdom, London</div>
          <div className="flex items-center gap-3"><FaEnvelope className="text-gray-600" /> jacob360@gmail.com</div>
        </div>

        {/* Experience Section */}
        <div className="mt-16 bg-gradient-to-r from-purple-400 to-orange-400 text-white p-12 rounded-xl">
          <h3 className="text-lg italic">Experience</h3>
          <h2 className="text-4xl font-bold">MY EXPERIENCE</h2>
          <p className="mt-2 max-w-lg">Hello there! My name is Jacob Jones. I am a web designer & developer, and I'm very passionate and dedicated to my work.</p>
          <button className="mt-4 bg-black text-white px-6 py-2 rounded-lg">Download my resume</button>

          <div className="mt-8">
            {[
              { year: "2018 - Present", role: "LEAD UI/UX DESIGNER", company: "Rolling Thunder" },
              { year: "2018 - 2010", role: "SENIOR UI/UX DESIGNER", company: "Locost Accessories" },
              { year: "2008 - 2006", role: "JUNIOR UI/UX DESIGNER", company: "Sagebrush" }
            ].map(({ year, role, company }) => (
              <div key={role} className="mt-6">
                <p className="text-gray-200 text-sm">{year}</p>
                <h4 className="text-xl font-bold">{role}</h4>
                <p className="text-gray-300">{company}</p>
              </div>
            ))}
          </div>
        </div>
      </main>
    </div>
  );
}
